import Home from './pages/Home'
import Conta from './pages/Conta'



function App() {


  return (
    <BrowserRouter>
    <ChakraProvider>
      <Layout>
      <Routes>
        <Route path='/' element={<Home />}/>
        <Route path='/conta' element={<Conta />}/>
      </Routes>
      </Layout>
    </ChakraProvider>

    </BrowserRouter>

  );
}

export default App;
